import './App.css';
import { ChakraProvider,Box ,Container,Flex,CSSReset} from '@chakra-ui/react'
import { } from '@chakra-ui/icons'
import Navbar from './components/navBar';
import LeftSideBar from './components/leftSideBar';


function App() {
  return (
    <ChakraProvider>
      <CSSReset />
      <Box>
        <Navbar />
        <LeftSideBar />
        <Container maxW="container.xl" p="4">
          {/* Main content goes here */}
          <h1>Main Content</h1>
        </Container>
      </Box>
    </ChakraProvider>
  );
}

export default App;
